


UPDATE `patients`
SET assurer = CASE 
    WHEN assurer = 0 THEN 'non'
    ELSE 'oui'
END;

UPDATE `patients`
SET sexe = CASE 
    WHEN sexe = 'F' THEN 'Mme'
    ELSE 'Mr'
END;

UPDATE `patients`
SET filiation = CASE 
    WHEN filiation = 1 THEN 'Adhérent(e)'
    WHEN filiation = 2 THEN 'Conjoint(e)'
    WHEN filiation = 3 THEN 'Enfant'
    ELSE Null
END;

UPDATE patients
JOIN assurances 
    ON patients.codeassurance = assurances.code
SET patients.assurance_id = assurances.id;

